import axios from 'axios';
 
const fetchQueue = async  () => {
    try {
        let response = axios.get('https://localhost:44447');
        console.log("Data = " + JSON.stringify(response));

        return (await response).data;
    } catch (e) {
        console.error(e);
    }
}
 
export default fetchQueue;
